import React, { Component } from 'react';
import {  Text, View,StyleSheet, TextInput} from 'react-native';
import { StatusBar } from 'expo-status-bar';
import {DateTimePicker}  from 'react-native-modal-datetime-picker';

class App extends Component{
    constructor(){
        super()
        this.state ={
            firstName:'',
            lastName:'',
            email:'',
            phoneNumber:'',

        }
    }
        
    
    render(){
        return(
            <View style = {styles.regform}>
                <View>
                   <Text style={styles.header}>
                       Registration Form</Text> 
                </View>
                
                <Text><b>FirstName</b></Text>
                <TextInput style = {styles.input}
                placeholder = 'FirstName' onChangeText = {(text) => {this.setState({firstName:text})}}>
                </TextInput>
                <Text><b>LastName</b></Text>
                <TextInput style = {styles.input}
                placeholder = 'LastName' onChangeText = {(text) => {this.setState({lastName:text})}}>
                </TextInput>
                <Text><b>Email</b></Text>
                <TextInput style = {styles.input}
                placeholder = 'email' onChangeText = {(text) => {this.setState({email:text})}}>
                </TextInput>
                <Text><b>PhoneNumber</b></Text>
                <TextInput style = {styles.input}
                    placeholder = 'PhoneNumber' onChangeText = {(text) => {this.setState({phoneNumber:text})}}>
                </TextInput>
                <Text>Date Of Birth</Text>
                
                
                

                


                

                
            </View>
             

            
        );
    }
}

const styles = StyleSheet.create({
regform : {
        textAlign:'center',
        backgroundColor:'lightblue',
        flex:1,
        alignSelf:'stretch',
        marginTop:StatusBar.currentHeight,
    
        
        
    },
header: {
    fontSize:24,
    color:'black',
    fontWeight:'bold',
    marginBottom:'40px',
    marginTop:'30px',
    textAlign:'center'

    

},
input:{
    
    width:'90%',
    backgroundColor:'white',
    padding:10,
    marginTop:10,
    marginBottom:10,
    marginLeft:'20px',
    borderRadius:'10px'
    
},
}

);
export default App;
